import React from 'react';
import './Slider.css';

const slidesInfo = [
    {
        src: 'https://image.freepik.com/foto-gratis/fondo-tecnologia-abstracta-codigo-programacion_34663-30.jpg',
        alt: "Proyecto 1",
        desc: "Proyecto 1"
    },
    {
        src: 'https://static.wixstatic.com/media/53333b_1ea4c83fcc8d4a3a8021afc11f367725.jpg/v1/fill/w_674,h_320,al_c,lg_1,q_80/53333b_1ea4c83fcc8d4a3a8021afc11f367725.webp',
        alt: "Proyecto 2",
        desc: "Proyecto 2"
    },
    {
        src: 'https://static.wixstatic.com/media/53333b_863828d3c6894243bc56f6e4a2e621ca~mv2.png/v1/fill/w_1200,h_590,al_c,q_90,usm_0.66_1.00_0.01/programacion.webp',
        alt: "Proyecto 3",
        desc: "Proyecto 3"
    }
]

const slides = slidesInfo.map(slide => (
    <div className="slide-container">
        <img src={slide.src} alt={slide.alt} />
        <div className="slide-desc">
            <span>{slide.desc}</span>
        </div>
    </div>
))

export default slides;
